"use strict";window.addEventListener("scroll",function(){const e=document.getElementById("totop");window.pageYOffset>300?e.style.display="block":e.style.display="none"});const checkClipboardJS=()=>typeof ClipboardJS!="undefined"&&ClipboardJS!==null;document.addEventListener("DOMContentLoaded",function(){if(!checkClipboardJS())return;var e=new ClipboardJS("button.copy-btn-fenced-code-block",{target:function(e){return e.nextElementSibling}});e.on("success",function(e){e.action=="copy"&&e.clearSelection()}),e.on("error",function(e){console.error("Action:",e.action),console.error("Trigger:",e.trigger)})})